import React, { useState, useEffect } from 'react';
import Facade from './ApiFacade'

import Accountinfo1 from '../components/Accountinfo1';
import Accountinfo2 from '../components/Accountinfo2';

export default function LoggedIn(props) {
  const [username, setUsername] = useState();
  const [balance, setBalance] = useState();
  const [role, setRole] = useState();

  useEffect(() => {
    Facade.fetchUser().then(res => { setUsername(res.userName); setBalance(res.balance); setRole(res.roleList) }).catch(e => console.log(e));
  }, [])


  return (
    <div class="row justify-content-md-center">
      <div class="col-sm-2 logged-in-left-menu logged-in-col">
        <div className="row left-menu-row"><div className="col align-self-center"><Accountinfo1 username={username}/></div></div>
        <div className="row left-menu-row"><div className="col align-self-center"><Accountinfo2 balance={balance}/></div></div>
        <div className="row left-menu-row"><input type="submit" class="fadeIn fourth logout-btn-1" onClick={props.logout} value="Log Out"></input></div>
      </div>

      <div class="col col-lg-10 logged-in-right-menu logged-in-col">.col-12 .col-sm-6 .col-md-8</div>

    </div>
  )
}
